import { StyleSheet } from 'react-native';

const Style = StyleSheet.create({
    container: {
        flex: 2,
        backgroundColor: '#00BFFF',
        alignItems: 'center',
    },

    text: {
        color: '#000000',
        fontWeight: 'bold',
        fontSize: 15,
        marginTop: ''
    }
});

export default Style;
